DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `editImage`(
in  productId    int(18),
in  inputStream  longblob,
in  imageType    varchar(20),
out queryStatus  boolean
)
BEGIN

	if exists(select * from images where product_id = productId) then
    
		if (imageType = 'iconImage') then        
			UPDATE images SET iconImage = inputStream WHERE product_id = productId;
        elseif  (imageType = 'image1') then   
            UPDATE images SET Image1 = inputStream WHERE product_id = productId;
		elseif  (imageType = 'image2') then   
            UPDATE images SET Image2 = inputStream WHERE product_id = productId;
		end if;      
        
        set queryStatus = true;

	elseif not exists(select * from images where product_id = productId) then
    
		if (imageType = 'iconImage') then        
			insert into images (product_id, iconImage) values (productId, inputStream);
        elseif  (imageType = 'image1') then   
            insert into images (product_id, Image1) values (productId, inputStream);
		elseif  (imageType = 'image2') then   
            insert into images (product_id, Image2) values (productId, inputStream);
		end if;  
        
        set queryStatus = true;
        
	else 
    
		set queryStatus = false;
        
	end if;
    
END ;;
DELIMITER ;
